2025-03-05 09:03:58.386+00	2025-03-05 14:16:04.574+00	5	3	12	Департамент Информационных Технологий г. Москвы	Мы — Департамент информационных технологий Правительства Москвы — команда профессионалов, чья работа не видна невооруженным глазом, но входит в жизнь все большего числа москвичей. Записаться к врачу с помощью сервиса ЕМИАС, проверить домашнее задание и оценки ребенка в Московской электронной школе, подать показания счетчиков через портал mos.ru — это лишь часть услуг и сервисов, которые доступны москвичам и реализуемые ДИТ. Мы хотим, чтобы возможности, которые дают сегодня информационные технологии, помогали каждому жителю Москвы, независимо от того, где он находится, получать актуальную именно для него информацию, оперативно решать важные вопросы и экономить самое ценное, что у него есть – время.\n\nВ 2012 году, только приступая к реализации «Информационного города», мы понимали, что развитие инфраструктуры города – это не только залог устойчивого развития современного общества, но и важное условие как для развития человеческого капитала – людей, так и для совершенствования экономики города. Мы ставили перед собой задачу сделать город и его ключевые сферы - медицину и образование - доступными, удобными и комфортными для каждого москвича.\n\nЗа минувшие годы успешно прошла информатизация и автоматизация отраслей городского хозяйства, появились ЕМИАС и МЭШ - уникальные информационные системы, аналогов которых нет в мире. Постоянно росло количество городских сервисов и услуг, которые можно получить онлайн и на одном ресурсе – портале Мэра и Правительства Москвы. Активно развивались сеть бесплатного городского Wi-Fi и система видеонаблюдения, сотовая связь. Город становился всё более доступным, удобным, комфортным и безопасным как для горожан, так и для его гостей.\n\nМногое уже сделано, но мы не останавливаемся на достигнутом. Наша задача - на перспективу 2019 – 2030 использовать созданную ИТ инфраструктуру и построить Умную Москву, в основе которой передовые технологии - искусственный интеллект, блокчейн, большие данные, 5G, технологии дополненной и виртуальной реальности.\n\nМы любим наш город и гордимся им.	https://www.mos.ru/dit/	<img src="https://i.postimg.cc/kG0bqR3n/image.png" alt="Логотип ДИТ">
2025-03-14 11:59:57.993+00	2025-03-14 20:13:04.435+00	6	3	12	Generus	Мы - RnD-компания в области автоматизации технологических процессов, прикладного Искуственного Интеллекта и разработки программного обеспечения.\n\nМы используем современные технологии и наукоемкие методы для творческого инженерного решения сложных кейсов.	\N	<img src="https://i.postimg.cc/GpydDv57/Frame-41-2-2.png" alt="Логотип Generus">
