24	2025-03-14 12:29:17.491+00	2025-03-14 12:29:17.625+00	39eon9hbbf8	2ef5e1d3-5e96-423b-8f20-e7ff19c44ac8	{"data":{"createdAt":"2025-03-14T12:29:17.409Z","updatedAt":"2025-03-14T12:29:17.451Z","id":20,"createdById":15,"updatedById":15,"task_name":"Разработка модели карты постоянных маршрутов","task_description":null,"task_date_start":null,"task_date_end":null,"company_id":6,"assignee_id":null,"task_solution_description":null,"task_solutino_url_gitpoject":null,"task_solution_answ":null,"sort_task_status":15,"catalogy_id":6,"pm_id":3,"task_dedline":"2025-04-02","task_date_public":"2025-03-14","task_competencies_id":18,"stakeholder_id":15,"task_status":"5nr907klkwy","admin_id":null,"task_markdown_description":"Необходимо разработать модель, обеспечивающую визуализацию на спутниковой карте отображение постоянных маршрутов пользователей мобильного приложения.\\n\\nГеоданные (координаты, скорость и др.) регистрируются с частотой 0,2 Гц (12 раз в минуту) и приходят батчами за 1 минуту с мобильных устройств на сервер. \\n\\nПо накапливаемой статистике данных необходимо построить модель, определяющую:\\n\\n1. Наиболее часто посещаемые места (длительные остановки в одном и том же месте).\\n2. Пункты начала и окончания перемещения среди таких мест.\\n3. Графы перемещений, соединяющие каждую пару таких мест.\\n4. \\"Апроксимированные\\" маршруты на полученных графах.\\n\\nИтоговая работа модели должна быть представлена в виде маршрутного графа на карте, где вершины - наиболее посещаемые места, а рёбра - апроксимированные маршруты между ними.\\n\\nТакже необходимо определить \\"оптимальный\\" интервал батча данных для построения модели (несколько дней, неделя, месяц) и учесть большое число выбросов в данных.\\n","task_stack":"Python, MovingPandas","task_link_git":null,"task_project_managers":{"createdAt":"2025-02-21T00:02:00.525Z","updatedAt":"2025-03-04T12:08:16.715Z","id":3,"nickname":"Deryabin|ProjectManager","email":"pm@deryabin.sa","password":"5023c4fe8ada69b811c0a6b857102c